import React, { useState, useEffect } from "react";
import axios from "axios"; // Axios for API calls
import Action1 from "../../../assets/icons/Action1.svg";
import AppointMentDetailModal from "./Modal/AppointMentDetailModal";

const AppointmentTable = () => {
  const [patients, setPatients] = useState([]);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    // Fetch appointment data on component mount
    const fetchAppointments = async () => {
      try {
        const res = await axios.get(
          "http://localhost:8080/appointment/all-appointments"
        );
        setPatients(Response.data); // Assuming the data is an array of appointments
      } catch (error) {
        console.error("Error fetching appointments:", error);
      }
    };

    fetchAppointments();
  }, []);

  const openModal = () => setShowModal(true);
  const closeModal = () => setShowModal(false);

  return (
    <div className="overflow-x-auto mx-5 my-5 ">
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr className="bg-gray-100">
            {/* Table Headers */}
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              #
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Name
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Age
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Email
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Gender
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Department
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Date
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Time
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Doctor
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Fees
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 "></th>
          </tr>
        </thead>
        <tbody>
          {patients.map((patient, idx) => (
            <tr key={patient.id}>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {idx + 1}
              </td>
              <td className="flex items-center py-4 border-b text-sm text-gray-700 text-center">
                <img
                  src={patient.image || "https://via.placeholder.com/50"}
                  alt="img"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {patient.name}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.age}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.email}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.gender}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.department}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.date}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.time}
              </td>
              <td className="flex items-center py-4 border-b text-sm text-gray-700 text-center">
                <img
                  src={patient.doctorImage || "https://via.placeholder.com/50"}
                  alt="doc"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {patient.doctor}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {patient.fees}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                <div className="flex">
                  <img
                    src={Action1}
                    alt="action"
                    onClick={openModal}
                    className="cursor-pointer"
                  />
                </div>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <AppointMentDetailModal show={showModal} onClose={closeModal} />
    </div>
  );
};

export default AppointmentTable;
